import React, { useState } from "react";
import { logout } from "../actions/userActions";
import { useDispatch, useSelector } from "react-redux";
import { useNavigate, Link } from "react-router-dom";

function HeaderContainer({ children }) {
  const dispatch = useDispatch();
  const [keyword, setKeyword] = useState("");
  const navigate = useNavigate();

  const submitHandler = (e) => {
    e.preventDefault();
    if (keyword.trim()) {
      navigate(`/cars/search/${keyword}`);
    } else {
      navigate("/cars");
    }
  };

  const userLogin = useSelector((state) => state.userLogin);
  const { userInfo } = userLogin;

  console.log(userInfo);

  const logoutHandler = () => {
    dispatch(logout());
  };

  return (
    <div className="container-md">
      <nav className="navbar navbar-expand-lg navbar-dark bg-salmon mb-4 p-2 rounded">
        <div className="container-fluid">
          <Link className="navbar-brand" to="/">
            CAR RENTAL
          </Link>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-5 ms-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <Link className="nav-link" aria-current="page" to="/cart">
                  <i className="bi bi-cart fs-5"></i>
                </Link>
              </li>
              {userInfo ? (
                // <li className="nav-item dropdown">
                //   <Link
                //     className="nav-link dropdown-toggle"
                //     id="navbarDropdownMenuLink"
                //     role="button"
                //     data-bs-toggle="dropdown"
                //     aria-expanded="false"
                //   >
                //     {userInfo.name}
                //   </Link>
                //   <ul
                //     className="dropdown-menu"
                //     aria-labelledby="navbarDropdownMenuLink"
                //   >
                //     <li>
                //       <Link className="dropdown-item" to="/profile">
                //         Profile
                //       </Link>
                //     </li>
                //     <li>
                //       <Link className="dropdown-item" onClick={logoutHandler}>
                //         Logout
                //       </Link>
                //     </li>
                //   </ul>
                // </li>
                <li className="nav-item dropdown">
                  <a
                    className="nav-link dropdown-toggle"
                    href="#"
                    id="navbarDropdown"
                    role="button"
                    data-bs-toggle="dropdown"
                    aria-expanded="false"
                  >
                    {userInfo.name}
                  </a>
                  <ul class="dropdown-menu" aria-labelledby="navbarDropdown">
                    <li>
                      <Link class="dropdown-item" to="/profile">
                        Profile
                      </Link>
                    </li>
                    <li>
                      <a class="dropdown-item" href="#">
                        Another action
                      </a>
                    </li>
                    <li>
                      <hr class="dropdown-divider" />
                    </li>
                    <li>
                      <a class="dropdown-item" href="#">
                        Something else here
                      </a>
                    </li>
                  </ul>
                </li>
              ) : (
                <li className="nav-item">
                  <Link className="nav-link" aria-current="page" to="/login">
                    <i className="bi bi-person-fill fs-5"></i> Sign In
                  </Link>
                </li>
              )}
            </ul>
            <form className="d-flex" onSubmit={submitHandler}>
              <input
                className="form-control me-2"
                type="search"
                placeholder="Search"
                aria-label="Search"
                value={keyword}
                onChange={(e) => setKeyword(e.target.value)}
              />
              <button className="btn btn-outline-cardialred" type="submit">
                <i className="bi bi-search"></i>
              </button>
            </form>
          </div>
        </div>
      </nav>
      {children}
    </div>
  );
}

export default HeaderContainer;
